import React from 'react';
import ReactDOM from 'react-dom';
import Faker from 'faker';

import CommentDetail from './CommentDetail';

const App = () => {
    return (
        <div className="ui container comments">
            <CommentDetail author="Sam" timeAgo="Today at 4:45PM" avatar={Faker.image.avatar}/>
            <CommentDetail author="Alex" timeAgo="Today at 2:00AM" avatar={Faker.image.avatar}/>
            <CommentDetail author="Jane" timeAgo="Today at 5:00PM" avatar={Faker.image.avatar}/>
        </div>
    )
}

ReactDOM.render(<App />, document.getElementById('root'));
